import { Route, BrowserRouter as Router, Switch } from "react-router-dom";
import Home from './Pages/Home';
import Gallery from './Pages/Gallery';

export const App = () => {
  return (
    <Router>
      <Switch>
        <Route path="/" component={Home} />
        <Route path="/gallery" component={Gallery} />
      </Switch>
    </Router>
  );
};
